import React from 'react';
import { carData } from '../carData';

export const CarList = () => {
    const styles = {
        ul:{
            border : '1px solid black',
            textAlign:'left'
        },
        div:{
            innerWidth:'40%'
        }
    }
  return (
    <div style={styles.div}>
        <ul style={styles.ul}>
            {carData.map(car=> (
                <li>{car.Name}</li>
            ))}
        </ul>
    </div>
  )
}
